import React from "react";
import styled from 'styled-components';

const MapContainer  = styled.div`
    transform: translate(20px, 10px);
    position: relative;
    top: 50%;
    display: flex;
    justify-content: center; /* Центрируем по горизонтали */
    align-items: center; /* Центрируем по вертикали */
    width: 604px;
    height: 374px;
    border-radius: 45px;
    box-shadow: 0px 10px 20.3px rgba(0, 0, 0, 0.25);
    overflow: hidden; /* Скрытие содержимого, выходящего за пределы */
    margin-top: 15px;
    left: 20%;
    padding: 30px;
`;


const MapComponent = () => {
    return (
        <div style={{ width: "604px", height: "450px", borderRadius: "45px", overflow: "hidden", top: "15px", left: "20%" }}>
            <iframe src="https://yandex.ru/map-widget/v1/?um=constructor%3A708f2da14b7c06ea6e59eddb02a9c4e54b9627268b3b8e5fbd0b1ff3c96326b0&amp;source=constructor&amp;ll=39.686249%2C47.279403&amp;z=16&amp;pt=39.686249%2C47.279403" width="100%" height="100%" frameBorder="0" />
        </div>
    );
};

export default MapComponent;
